import React from 'react' ; 
function Social(){
    return (
        <div className="container bg-primary ">
        <ul className="  list-group">
        <li className="list-group-item bg-dark text-white"> <input type="checkbox" id="box1" className = "form-check-input " />  <label for="box1"  >Mohannad </label>  </li>
        <li className="list-group-item bg-light"> <input type="checkbox" id="box2" className = "form-check-input" /><label for="box2"  >Jalal</label> </li>
        <li className="list-group-item bg-dark text-white"> <input type="checkbox" id="box3" className = "form-check-input" /><label for="box3"   >jayousi</label> </li>

  </ul>
  </div>
    );
}

export default Social ;
